            <ul className="list-unstyled">
                {perInfo.map(e => (
                    <li className="d-flex justify-content-between my-3" key={e.type}>
                        <span className="text-uppercase fs-13 language">{e.type}</span>
                        <span className="text-capitalize fs-14">{e.inf}</span>
                    </li>
                ))}
            </ul>
        </div>
    )
}

